import { useNavigate } from "react-router"
import { Footer } from "./Footer"
import { Header } from "./Header"
import { useEffect, useState } from "react"
import axios from "axios"



export const AdvisterZone = () => {

    let nav = useNavigate()

    if (sessionStorage.getItem("advisterToken") == null)
        nav("../home")

    const [apartments, setApartments] = useState([])

    useEffect(() => {
        axios.get(`/apartment/advertiser`, {
            headers: {
                Authorization: "Bearer " + sessionStorage.getItem("advisterToken")
            }
        })
            .then((x) => {
                setApartments(x.data)
            })
            .catch((err) => {
                console.log(err.response.data.message);
            })
    }, [])

    return (
        <>
            <Header advisterZone={false}></Header>

            {apartments.map((a) => <>
                <h3>{a.name}</h3>
                <h3>{a.description}</h3>
                <h3>{a.address}</h3>
                <h3>{a.countOfBeds}</h3>
                <h3>{a.price}</h3>
                <h3>{a.category.name}</h3>
                <h3>{a.city.name}</h3>
            </>
            )}
            {/* <h1>advister zone</h1> */}
            <Footer></Footer>
        </>
    )
}
